import React from "react";
import { Link } from "react-router-dom";
import { NavList, LinkStyled } from "./Navs.styled";
const LINKS = [
  { to: "/", text: "Home" },
  { to: "/starred", text: "Starred" },
];
const Nav = () => {
  return (
    <div>
      <NavList>
        {LINKS.map((item) => (
          <li key={item.to}>
            {" "}
            <LinkStyled to={item.to}>{item.text}</LinkStyled>
          </li>
        ))}
      </NavList>
    </div>
  );
};

export default Nav;
